interface ERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    // Add other ERC-20 functions as needed
}

contract RentalBike {
    address owner;
    ERC20 public usdt;
    UserRegistration userRegistration = UserRegistration(msg.sender);


    constructor() {
        owner = msg.sender;
        //usdt = ERC20(_usdtAddress);
        //userRegistration = UserRegistration(msg.sender);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the Owner can call this function");
        _;
    }

    function saveRenterDetails(address _walletAddress) internal view returns (bool) {
        //(string memory name, bool canRent, uint balance, bool isRegistered) = userRegistration.getRenterDetails(_walletAddress);
        (, , , bool isRegistered,) = userRegistration.getRenterDetails(_walletAddress);
        // Save renter details in a variable or perform any other actions
        return isRegistered;
    }

    struct Rental {
        uint rentalId;
        address renterAddress;  // Address of the renter
        uint bikeId;            // ID of the rented bike
        uint256 startDate;      // Start time of the rental agreement (timestamp)
        uint256 endDate;
        uint rentalDuration;
        uint pricePerHour;
        uint256 rentalFee;      // Fee for the rental agreement
        bool isActive;          //true when the rental agreement is initiated and set to false when the bicycle is returned
    }

    mapping(uint256 => Rental) public rentals; 
    uint public numberOfRentals=0;
    uint public bikeId = 0;
    uint public latestRentalId = 0;
    uint256[] public rentalIds;   // Array that will hold all the rental ids, so we can easily access them later on

    // constructor for rental struct   

    // function that allows a renter rent a bike
    function rentABike(address _wallet) public {
        // check if the renter is registered and if the bike is available
        //require(saveRenterDetails(msg.sender), "Renter is not registered.You need to be registered first!");
        
        // take of the bikeId from rentals and check her  availability
        //require(!bikes[_rentalId].available, "Bike not available");
        //require(!rentals[_rentalId].available, "Bike not available");
        //require(renterAddress.balance > 0, "Renter has no funds in his wallet.");
        // Assign the renter address to the renterAddress variable
        rentals[latestRentalId].renterAddress = _wallet;    // msg.sender;

        // set the starDate
        rentals[latestRentalId].startDate = block.timestamp;
        rentals[latestRentalId].isActive =  true;
       
        // Update the status of the bike
        //bikes[_bikeId].available = false;

        // create a new rental record
        rentalIds.push(latestRentalId);
        rentals[latestRentalId] = Rental(latestRentalId, msg.sender, bikeId, block.timestamp, 0, 0, 1, 0, true);

        // update the number of active rentals
        numberOfRentals++;

        // emit a rental event
        //emit rentABike(latestRentalId, _bikeId);

        // update the latest rental ID
        latestRentalId++;
        bikeId++;
    }

    // function that returns a bike to be used again
    //function returnABike(uint _bikeId, uint _rentalId) public {
    function returnABike(uint _rentalId) public {
        // Require that the user has actually hired the bike
        //require(,"You haven't hired this bike yet.");

        rentals[_rentalId].endDate = block.timestamp;
        // Calculate how much time was spent on the bike
        //uint256 rentalDuration = (rentals[_rentalId].endDate - rentals[_rentalId].startDate) / 3600;
        // hours - rentals[_rentalId].rentalDuration = (rentals[_rentalId].endDate - rentals[_rentalId].startDate) / 3600;
        rentals[_rentalId].rentalDuration = (rentals[_rentalId].endDate - rentals[_rentalId].startDate) / 60;
        // Calculate the rental fee
        rentals[_rentalId].rentalFee = rentals[_rentalId].rentalDuration * rentals[_rentalId].pricePerHour;
        
        
        rentals[_rentalId].isActive =  false;
        //payment
        // Update the status of the bike
        //bikes[_bikeId].available = true;
    }

    // Get total duration of a bike use/trip
    /*function getDuration(uint256 _startDate, uint256 _endDate) internal pure returns(uint){
        require(_endDate >= _startDate, "End date must be greater than or equal to start date");
        return (_endDate - _startDate)/3600;   // Duration is returned in hours
    }*/

}
